import { Link } from 'react-router-dom';
import { Jumbotron, Container, Row, Col, Image, Button } from 'react-bootstrap';
import './InfoPage.css';


export default class InfoPage extends Component {
    render() {
        return (
        // like container
        <Container> 
            <Jumbotron>
            <h2>Info</h2>
            </Jumbotron>
        </Container>
        )
    }
}
